import React, { useState } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faPlateWheat, faList, faCalendarDay} from '@fortawesome/free-solid-svg-icons';


type ModaleProps = {
    isOpen: boolean;
    onClose: () => void;
    children?: React.ReactNode;
};

const Modale: React.FC<ModaleProps> = ({ isOpen, onClose, title, category, children }) => {
    const [selectedDate, setSelectedDate] = useState<Date | null>(null);
    const [selectedList, setSelectedList] = useState("");

    const handleDateChange = (date: Date | null) => {
        if (date) {
            setSelectedDate(date);
            setSelectedList(""); // reset the value of selectedList
        }
    };

    if (!isOpen) return null;

    return (
        <div className="fixed z-10 inset-0 overflow-y-auto">
            <div className="flex items-end justify-center min-h-screen pt-4 px-4 pb-20 text-center sm:block sm:p-0">
                <div
                    className="fixed inset-0 transition-opacity"
                    aria-hidden="true"
                    onClick={onClose}
                >
                    <div className={`absolute inset-0 bg-gray-300 opacity-80`}></div>
                </div>
                <span
                    className="hidden sm:inline-block sm:align-middle sm:h-screen"
                    aria-hidden="true"
                >

                </span>
                <div
                    className="inline-block align-bottom bg-white rounded-lg text-left overflow-hidden shadow-xl transform transition-all sm:my-8 sm:align-middle sm:max-w-lg sm:w-full"
                    role="dialog"
                    aria-modal="true"
                    aria-labelledby="modal-headline"
                >
                    <div className="bg-white dark:bg-gray-800 px-4 pt-5 pb-4 sm:p-6 sm:pb-4">
                        <div className="overflow-y-scroll scroll-hide-1700 max-h-[60vh] dark:scrollbarDark scrollbarLight">
                            <h2 className="text-[#ef4060] dark:hover:text-[#FA5252] text-4xl text-center font-bold">
                                T-Shirt Design Project
                            </h2>
                            <div className="grid grid-cols-1 lg:grid-cols-2 my-6 pr-3">
                                <div className="space-y-2">
                                    <p className="dark:text-white flex items-center text-[15px] sm:text-lg">
                                        <i className="fa-regular fa-file-lines sm:text-lg hidden sm:block mr-4 md:text-xl"></i>
                                        Project :&nbsp;
                                        <span className="font-medium"> Website</span>
                                    </p>
                                    <p className="dark:text-white flex items-center text-[15px] sm:text-lg">
                                        <i className="fa-solid fa-code text-lg mr-2 hidden sm:block"></i>
                                        Langages :&nbsp;
                                        <span className="font-medium">Photoshop, Figma</span>
                                    </p>
                                </div>
                                <div className="space-y-2">
                                    <p className="dark:text-white flex items-center mt-2 lg:mt-0 text-[15px] sm:text-lg">
                                        <i className="fa-regular fa-user text-lg mr-2 hidden sm:block"></i>
                                        Client :&nbsp; <span className="font-medium">Envato</span>
                                    </p>
                                    <p className="dark:text-white flex items-center text-[15px] sm:text-lg">
                                        <i className="fa-solid fa-arrow-up-right-from-square text-lg mr-2 hidden sm:block"></i>
                                        Preview :&nbsp;
                                        <span className="font-medium transition-all duration-300 ease-in-out hover:text-[#ef4060]">
                                          <a href="https://www.envato.com" target="_blank" rel="noopener noreferrer">www.envato.com</a>
                                        </span>
                                    </p>
                                </div>
                            </div>

                            <p className="dark:text-white text-2line font-normal text-[15px] sm:text-sm">
                                Lorem ipsum dolor sit amet consectetur, adipisicing elit.
                                Mollitia placeat magnam possimus iusto blanditiis pariatur
                                labore explicabo quo repellat hic dolorum numquam
                                asperiores, voluptatum fugiat reiciendis aspernatur, non,
                                odio aperiam voluptas ex tempora vitae. Dolor, consequatur
                                quidem! Quas magni distinctio dolorum dolore natus, vel
                                numquam accusamus. Nostrum eligendi recusandae qui tempore
                                deserunt!
                            </p>
                            <div className="pr-3">
                                <img className="w-full md:h-[450px] h-auto object-cover rounded-xl mt-6"
                                     src="./images/work_images/3.jpg" alt="portfolio image"/>
                            </div>
                        </div>
                        <button onClick={onClose} className="close bg-close-light dark:bg-close-dark">
                            Close
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Modale;
